/** @format */

import React, { useState } from "react";
import "../../styles/find-car-form.css";
import { Form, FormGroup, Label, Input, Button } from "reactstrap";

// Dữ liệu mẫu cho các xe
const carsData = [
  { id: 1, name: "Toyota Camry", type: "Sedan", location: "Hà Nội" },
  { id: 2, name: "Honda CR-V", type: "SUV", location: "Hồ Chí Minh" },
  { id: 3, name: "Mazda CX-5", type: "MPV", location: "Đà Nẵng" },
  // Thêm các xe khác ở đây
];

const FindCarForm = () => {
  const [pickupAddress, setPickupAddress] = useState("");
  const [dropoffAddress, setDropoffAddress] = useState("");
  const [rentalDate, setRentalDate] = useState("");
  const [rentalTime, setRentalTime] = useState("");
  const [carType, setCarType] = useState("sedan");
  const [filteredCars, setFilteredCars] = useState(carsData);

  const handleSubmit = (e) => {
    e.preventDefault();

    // Lọc các xe dựa trên các điều kiện tìm kiếm
    const filtered = carsData.filter((car) => {
      return (
        car.type === carType // Lọc theo loại xe
        // Có thể thêm các điều kiện lọc khác như địa chỉ, ngày thuê, giờ thuê nếu cần
      );
    });

    setFilteredCars(filtered);
  };

  return (
    <div>
      <Form className="form" onSubmit={handleSubmit}>
        <div className="d-flex align-items-center justify-content-between flex-wrap">
          {/* Địa chỉ nhận xe */}
          <FormGroup className="form__group">
            <Label for="pickupAddress">Địa chỉ nhận xe</Label>
            <Input
              id="pickupAddress"
              type="text"
              placeholder="Nhập địa chỉ nhận xe"
              value={pickupAddress}
              onChange={(e) => setPickupAddress(e.target.value)}
            />
          </FormGroup>

          {/* Địa chỉ trả xe */}
          <FormGroup className="form__group">
            <Label for="dropoffAddress">Địa chỉ trả xe</Label>
            <Input
              id="dropoffAddress"
              type="text"
              placeholder="Nhập địa chỉ trả xe"
              value={dropoffAddress}
              onChange={(e) => setDropoffAddress(e.target.value)}
            />
          </FormGroup>

          {/* Ngày thuê */}
          <FormGroup className="form__group">
            <Label for="rentalDate">Ngày thuê</Label>
            <Input
              id="rentalDate"
              type="date"
              value={rentalDate}
              onChange={(e) => setRentalDate(e.target.value)}
            />
          </FormGroup>

          {/* Giờ thuê */}
          <FormGroup className="form__group">
            <Label for="rentalTime">Giờ thuê</Label>
            <Input
              id="rentalTime"
              type="time"
              value={rentalTime}
              onChange={(e) => setRentalTime(e.target.value)}
            />
          </FormGroup>

          {/* Loại xe */}
          <FormGroup className="select__group">
            <Label for="carType">Loại xe</Label>
            <Input
              id="carType"
              type="select"
              value={carType}
              onChange={(e) => setCarType(e.target.value)}>
              <option value="sedan">Sedan</option>
              <option value="suv">SUV</option>
              <option value="mpv">MPV</option>
            </Input>
          </FormGroup>

          {/* Nút tìm xe */}
          <FormGroup className="form__group">
            <Button className="btn find__car-btn" type="submit">
              Tìm xe
            </Button>
          </FormGroup>
        </div>
      </Form>

      {/* Bảng kết quả tìm kiếm */}
      <div>
        <h3>Kết quả tìm kiếm</h3>
        <table className="table">
          <thead>
            <tr>
              <th>Tên xe</th>
              <th>Loại xe</th>
              <th>Địa chỉ</th>
            </tr>
          </thead>
          <tbody>
            {filteredCars.map((car) => (
              <tr key={car.id}>
                <td>{car.name}</td>
                <td>{car.type}</td>
                <td>{car.location}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default FindCarForm;
